function AddUserPlus(n,t,i,r,u,f){isUserLogin?$.ajax({type:"post",url:"/Main/AddUserPlus",data:"objectId="+n+"&title="+t+"&plusType="+i+"&toUserId="+r+"&id="+u,success:function(n){var t=parseInt($(f).text());n==0?layer.msg("点赞异常,请稍后尝试"):n==1?(t=t+1,$(f).text(t),layer.msg("点赞成功")):n==-1&&(t=t-1,$(f).text(t),layer.msg("取消点赞成功"))}}):layer.msg("请您先登录")}var isUserLogin=!1;